import { Table } from 'reactstrap';

const TableItem = (data) => {
    return (
        <div className="TableITem">
            <h1>Table</h1>
            <Table>
                <thead>
                    <tr>
                        <th>#</th>
                        <th></th>
                    </tr>
                </thead>
            </Table>
        </div>
    )
}

export default TableItem;
